import styled from "styled-components"

const NavWrapper = styled.div`
  background-color: lightgreen;
  width: 500px;
  border-radius: 5px;
  display: flex;
  justify-content: space-around;

  .nav--button {
    border: none;
    margin-top: 5px;
    margin-bottom: 5px;
    height: 20px;
  }
`

function Nav() {
  return(
    <NavWrapper>
      <button className="nav--button">
        카테고리 1
      </button>
      <button className="nav--button">
        카테고리 2
      </button>
      <button className="nav--button">
        카테고리 3
      </button>
      <button className="nav--button">
        카테고리 4
      </button>
    </NavWrapper>
  )
}

export default Nav
